function Navbar() {
    return (
        <nav class="navbar bg-dark">
            <form class="container-fluid bg-dark">
                <div class="input-group">
                    <input type="text" class="form-control" placeholder="Kelime Ara" aria-label="Username" aria-describedby="basic-addon1"/>
                </div>
            </form>
        </nav>
    );
}

export default Navbar;
